Defendant Cordell M Howze in court with attorney Vincent Paul Guimont.  Defendant Cordell M Howze in custody.  Jacob D. Corr appeared for the State of Wisconsin.  Deputy Court Clerk: dds.

Sentencing proceeded.  Statements made by State, defense and defendant. 
 
The Court sentenced the defendant to a MAXIMUM TERM OF IMPRISONMENT of 9 YEARS, CONSECUTIVE to any other time with credit for 253 days served. The INITIAL TERM OF CONFINEMENT in the Wisconsin State Prison System is 5 YEARS.  The MAXIMUM TERM OF EXTENDED SUPERVISION IS 4 YEARS.

The defendant IS NOT eligible for the Challenge Incarceration Program and the Substance Abuse Program.

CONDITIONS OF EXTENDED SUPERVISION:
*Mental health assessment and successfully complete follow-up treatment;
*Take any prescription medication only in the manner/dosage as prescribed by a treating physician;
*Cooperate with any and all rules set forth by the probation agent;
*No new law violations rising to the level of probable cause;
*Participate in Cognitive Thinking program;
*Obtain/maintain full time employment or full time school and part time employment;
*Pay all supervision fees;
*Provide DNA sample if not previously done so- pay surcharge;
*Pay all applicable mandatory surcharges, fees, assessments, and costs; 

State in compliance with victim rights legislation.  The Court ordered restitution set at zero.  The Court ordered that all financial obligations be paid through collection of sums by the Department of Corrections from 25% of funds under Sec. 973.05(4)(b) and as a condition of extended supervision.  Any amount remaining due and owing is subject to civil judgment.  Pursuant to Wisconsin Statutes Section 973.176, the Court advised the defendant of the following restrictions:  Firearm possession and Voting.
Appeal rights given.
